svg.script:
    
	var nodes,cls,obc, classname,oldclass,nodes2;
	var tagArr=[];
	 var myMapApp = new mapApp(false, undefined); //与tooltip相关
    var obc; //
    window.onSVGLoad = initLater();
    function initLater() {
        //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
               window.setTimeout("init()",3000);
		 window.setTimeout("init()",5000);
		 window.setTimeout("init()",7000);
		 window.setTimeout("init()",10000);
    }
    function init() {

         /* 添加tooltip*/
         //tooltip styles
         var tooltipTextStyles = {
             "font-family": "Arial,Helvetica",
            "fill": "dimgray",
            "font-size": 1300
        };
        var tooltipRectStyles = {
             "fill": "white",
            "stroke": "dimgray"
        };
         myMapApp.initTooltips("toolTip", tooltipTextStyles, tooltipRectStyles, 10, 20, 3);
         //add tooltip to element
         myMapApp.addTooltip("layer_1", undefined, true, false, "target", "name");
	//	 myMapApp.addTooltip("lunkuo", undefined, true, false, "target", "name");
	}
	     function Highlight(evt) {
	 var obj = evt.target;
	 classname=obj.id;
	 nodes = document.getElementsByTagName("path");
	 var k=0;
     for(var i=0,j=nodes.length;i<j;i++){
	 cls=nodes[i].getAttribute("class").split(' ') || nodes[i].className.split(' ');
     obc=cls[1];
	 
	 if(obc==classname){
	  oldclass= nodes[i].getAttribute("class")|| nodes[i].className;
	 nodes[i].setAttribute("class","fil111");
	
	 tagArr[k]=nodes[i];
	 k++;
	 }
	 }
	 cls=null;
	 obc=null;
	 nodes2 = document.getElementsByTagName("polygon");

     for(var i=0,j=nodes2.length;i<j;i++){
	 cls=nodes2[i].getAttribute("class").split(' ') || nodes2[i].className.split(' ');
     obc=cls[1];
	 
	 if(obc==classname){
	 oldclass= nodes2[i].getAttribute("class")|| nodes2[i].className;
	 nodes2[i].setAttribute("class","fil111");
	
	 tagArr[k]=nodes2[i];
	 k++;
	 }
	 }
   
}
    
	 //鼠标移开后恢复
	 function HighlightRecover(evt) {
	
     for(var i=0,j=tagArr.length;i<j;i++){
	//alert("1");
	 tagArr[i].setAttribute("class",oldclass);
	 tagArr[i]=null;
	 }
	 oldclass=null;
	 }
	 
	 	 	function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style","visibility:hidden");
	}
